const Footer = () => {
    return (
<footer className="w-full absolute bottom-0 bg-gray-200 flex flex-col items-center">
    <div className="relative w-full mt-2">
        {/* Angled Lines */}
        {Array.from({ length: 11 }).map((_, index) => {
            const angle = (index - 5) * -10; // Adjust angle (-50 to +50 degrees)
            return (
                <div
                    key={index}
                    className="w-1 h-40 bg-black absolute"
                    style={{
                        transform: `rotate(${angle}deg)`,
                        transformOrigin: "bottom center",
                        left: `${50 + index * 6}%`, // Spacing the angled lines out
                    }}
                ></div>
            );
        })}

        {/* Horizontal Lines */}
        {Array.from({ length: 3 }).map((_, index) => (
            <div
                key={index}
                className="w-full h-1 bg-black absolute"
                style={{
                    top: `${index * 15}px`, // Distance between horizontal lines
                }}
            ></div>
        ))}
    </div>
</footer>



    );
};

export default Footer;
